import { RouterModule, Routes } from '@angular/router';

const routes: Routes = [
  {path:'',component:MesAbonnementsComponent}

];

@NgModule({
  imports: [RouterModule.forChild(routes)],
  exports: [RouterModule]
})
export class MesAbonnementsRoutingModule { }
